import React,{Component} from 'react';
import "./Header.css";
import Menu, {SubMenu, MenuItem} from 'rc-menu';

class Header  extends React.Component {
  render () {
    <Menu>
      <MenuItem>1</MenuItem>
      <SubMenu title="2">
      <MenuItem>2-1</MenuItem>
      </SubMenu>
    </Menu>
  }
}

export default Header;
